import React from "react";
import HomeIcon from '@mui/icons-material/Home';
const Sidebar = () => {
  return (
    <div className="w-1/4 border-2 bg-slate-900 text-white p-5 font-extralight">
        <div className="text-center text-3x1">GYM Master</div>
      <div className="flex gap-5 my-5">
        <div className="w-[100px] h-[100px] rounded-lg">
          <img
            className="w-full h-full rounded-full"
            src="https://imgs.search.brave.com/fee2UY0F5J2J9P73fThigaKVQrEHC3bLvulgtlrOKDI/rs:fit:500:0:0:0/g:ce/aHR0cHM6Ly9jZG4u/YXBwZGVzaWduLmRl/di93cC1jb250ZW50/L3VwbG9hZHMvMjAx/OS8wNC9wYSVDQyU4/MWdpbmFzLXdlYi1w/YXJhLWdpbW5hc2lv/cy5qcGc"
          />
        </div>
        <div>
          <div className="text-2xl">Good Morning</div>
          <div className="text-xl mt-1 font-semibold">admin</div>
        </div>
      </div>
      <div className="mt-10 py-5  border-t-2 border-gray-700">
        <div className="flex gap-2 font-semibold text-xl bg-slate-800 p-3 rounded-xl cur">
            <div><HomeIcon/></div>
             <div>dashboard</div>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
